  "short_description": "Reconstruct crime scenes. Make laws of physics work for the Law.",
  "long_description": "COOL FOR: FORENSIC SCIENTISTS. TACTICAL FIGHTERS. MATH-MINDED PEOPLE.\n\nVisual Calculus verses you not only in the laws of the state, but the laws of nature. It enables you to create virtual crime-scene models in your minds eye. Youll see how a bullet shattered the glass, and from that trace its trajectory with mathematical precision. Youll also count so many footprints  and at a glance discern shoe size and design; as well as the height, weight, and gender of the one who wore them.\n\nAt high levels, Visual Calculus makes the world reveal its secrets to you  but you may be so absorbed by your mind-diorama, you dont notice as crooks steal your pants. However, at low levels, your minds eye will be blind. Reconstructing crime scenes will be difficult without outside help.",
  "color": 2
}
